import React, { useEffect } from 'react'
import { NavLink } from 'react-router-dom';
import logo from '../../assets/images/logo.png'
const Sidebar = () => {

    useEffect(() => {
        function getClosest(elem, selector) {

            // Element.matches() polyfill
            if (!Element.prototype.matches) {
                Element.prototype.matches =
                    Element.prototype.matchesSelector ||
                    Element.prototype.mozMatchesSelector ||
                    Element.prototype.msMatchesSelector ||
                    Element.prototype.oMatchesSelector ||
                    Element.prototype.webkitMatchesSelector ||
                    function (s) {
                        var matches = (this.document || this.ownerDocument).querySelectorAll(s),
                            i = matches.length;
                        while (--i >= 0 && matches.item(i) !== this) { }
                        return i > -1;
                    };
            }

            // Get the closest matching element
            for (; elem && elem !== document; elem = elem.parentNode) {
                if (elem.matches(selector)) return elem;
            }
            return null;

        };
        var menuItems = document.getElementsByClassName("sub-menu-item");
        if (menuItems) {

            var matchingMenuItem = null;
            for (var idx = 0; idx < menuItems.length; idx++) {
                if (menuItems[idx].href === window.location.href) {
                    matchingMenuItem = menuItems[idx];
                }
            }

            if (matchingMenuItem) {
                matchingMenuItem.classList.add('active');
                var immediateParent = getClosest(matchingMenuItem, 'li');
                if (immediateParent) {
                    immediateParent.classList.add('active');
                }

                var parent = getClosest(matchingMenuItem, '.parent-menu-item');
                if (parent) {
                    parent.classList.add('active');
                    var parentMenuitem = parent.querySelector('.menu-item');
                    if (parentMenuitem) {
                        parentMenuitem.classList.add('active');
                    }
                    var parentOfParent = getClosest(parent, '.parent-parent-menu-item');
                    if (parentOfParent) {
                        parentOfParent.classList.add('active');
                    }
                } else {
                    var parentOfParent = getClosest(matchingMenuItem, '.parent-parent-menu-item');
                    if (parentOfParent) {
                        parentOfParent.classList.add('active');
                    }
                }
            }
        }
    }, [])
    const onActive = () => {

    }
    return (
        <>
            <div className="page-wrapper doctris-theme toggled">
                <nav id="sidebar" className="sidebar-wrapper">
                    <div className="sidebar-content">
                        <div className="sidebar-brand">
                            <a >
                                <img src={logo} />
                            </a>
                        </div>
                        <ul className="sidebar-menu">

                            <li>
                                <NavLink><i className="fi fi-rr-dashboard"></i> Dashboard</NavLink>
                            </li>

                            <li className="sidebar-dropdown">
                                <NavLink ><i className="fi fi-rr-users"></i> Users</NavLink>
                                <div className="sidebar-submenu">
                                    <ul>
                                        <li><NavLink >Loren</NavLink></li>
                                        <li><NavLink >Loren</NavLink></li>
                                    </ul>
                                </div>
                            </li>

                            <li className="sidebar-dropdown">
                                <a ><i className="fi fi-rr-pharmacy"></i> Month Long course</a>
                                <div className="sidebar-submenu">
                                    <ul>
                                        <li><NavLink >Loren</NavLink></li>
                                        <li><NavLink >Loren</NavLink></li>
                                    </ul>
                                </div>
                            </li>

                            <li className="sidebar-dropdown" >
                                <a><i className="fi fi-rr-test-tube"></i>  Year Long course</a>
                                <div className="sidebar-submenu">
                                    <ul>
                                        <li><NavLink to='/module'>Modules</NavLink></li>
                                        <li><NavLink to='/topic'>Topics</NavLink></li>
                                    </ul>
                                </div>
                            </li>

                            <li><NavLink ><i className="fi fi-rr-briefcase"></i> Quiz</NavLink></li>

                            <li><a ><i className="fi fi-rr-question-square"></i> Flashcard</a></li>
                            <li><a ><i className="fi fi-rr-question-square"></i> Audio Suggestion</a></li>
                        </ul>
                    </div>
                </nav>
            </div>
        </>
    )
}

export default Sidebar;
